// Class Solution copy here
class Solution {
private:
    unordered_map<char, int> mp; 
    unordered_set<char> st = {'a','e','i','o','u'};

    bool isValidVowels() {
        if(mp['a'] == 0) return false;
        if(mp['e'] == 0) return false;
        if(mp['i'] == 0) return false;
        if(mp['o'] == 0) return false;
        if(mp['u'] == 0) return false;
        return true;
    }

public:
    long long countOfSubstrings(string word, int k) {
        // 97 = a, 122 = z
        // 0000001111122222233334455
        queue<char> que;
        int consonant = 0;
        // 0:a 1:e 2:i 3:o 4:u
        long long ret = 0;
        long long localRet = 0;
        
        for(int i = 0;  i < word.size(); i++) {
            // push into queue
            assert(word[i] <= 'z');
            assert(word[i] >= 'a');
            que.push(word[i]);

            // record information
            if(st.count(word[i])) {
                // vowels
                mp[word[i]]++;
            } else {
                // consonant
                consonant++;
            }

            
            // when consonant over k, we pop out consonant
            if(consonant > k) {
                cout << word[i] << " " << consonant << endl;
                while (st.count(que.front()))
                {
                    mp[que.front()]--;
                    assert(mp[que.front()] >= 0);
                    que.pop();
                }
                consonant--;
                localRet = 0;
                que.pop();
            }
            
            // ret++
            if(isValidVowels() && consonant == k) {
                cout << word[i] << " " << isValidVowels() << endl;
                ret++;
                cout << mp[que.front()] << endl;
                if(st.count(word[i])) {
                    ret += localRet;
                }
                while (mp[que.front()] >= 2)
                {
                    assert(mp[que.front()] >= 0);
                    mp[que.front()]--;
                    que.pop();
                    ret++;
                    localRet++;
                }
            }
        }

        return ret;
    }
};

